// @flow strict

// $FlowIgnore
import styled from 'styled-components';

// List
const List = styled.ul`
	align-items: center;
	display: flex;
	justify-content: ${props => props.justify ?? "flex-start" };
	list-style: none;
	margin-left: -10px;
	width: 100%;
`;

export { List };
